import React from 'react';
import Card from '../Card';
import s from '../Card/Card.module.css';

const CardList = ({item = []}) => {
    return (
        <div>
            <div>
                {
                    item.map(({eng, rus}, index) => <Card key={index} eng={eng} rus={rus}/>)
                }
            </div>
        </div>
    );
}

export default CardList;
